import { Router, Route, Routes } from 'react-router';
import ChatPage from './components/ChatPage';
import StartPage from './components/StartPage';


function App() {
  return (


      <Routes>
        <Route path="/" element={<ChatPage />} />
        <Route path="/start" element={<StartPage />} />
      </Routes>
  );
}

export default App;
